import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends ReaComponent{

  async componentDidMount() {
    try {
      const res = await fetch('http://localhost:8000/farm/');
      const todoList = await res.json();
      this.setState({
        todoList
      });
    } catch (e) {
      console.log(e);
    }
  }

  render(): React.ReactNode {
    return (
      <div >
        <header>
          Hello
        </header>
      </div>
    )
  }
}

export default App;
